import React from "react";
import OrderForm from "./components/OrderForm";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./components/Home";
//import { OrderForm } from "./components/OrderForm";
const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/OrderForm">
          <OrderForm />
        </Route>

        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
};
export default App;
